import React from "react";
import { Link } from "react-router-dom";
import {
  Navbar,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from "reactstrap";
import CreatePost from "./CreatePost";

function Header() {
  return (
    <>
      <Navbar color="dark">
        <NavbarBrand>DDU Events</NavbarBrand>
        <Nav className="me-auto" navbar>
          <NavItem>
            <NavLink tag={Link} to="/CreatePost">CreatePost</NavLink>
          </NavItem>
        </Nav>
      </Navbar>
    </>
  );
}

export default Header;
